import React from 'react';
import './Dashboard.css';
import FilterPanel from './FilterPanel';
import MapView from './MapView';
import InsightsPanel from './InsightsPanel';

function Dashboard() {
  return (
    <div className="dashboard-wrapper">
      <FilterPanel />
      <MapView />
      <InsightsPanel />
    </div>
  );
}

export default Dashboard;
